import React from 'react';
import ReactDOM from 'react-dom';

class CountrySelector extends React.Component {
  constructor(props) {
    super(props);
    this.state = {};
  }
  render() {
    return (
    "Select a country",
      <form>
          <select value={this.state.country}>
            <option value="Nederland">Nederland</option>
            <option value="China">China</option>
          </select>
      </form>
    );
  }
}

class InformationSelector extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            isTemperature: false,
            isDistance: false
        };
    }
    OnChangeTemperature = () => {
        this.setState(initialState => ({
            isTemperature: !initialState.isTemperature,
        }));
    }
    OnChangeDistance = () => {
        this.setState(initialState => ({
            isDistance: !initialState.isDistance,
        }));
    }

    onSubmit = (e) => {
        e.preventDefault();
        console.log(this.state);
    }

    render() {
        return (
        "Select the information you seek",
        <form>
            <label>
              Temperature
              <input
                name="Temperature"
                type="checkbox"
                checked={this.state.name} />
            </label>
            <label>
              Distance
              <input
                name="Distance"
                type="checkbox"
                checked={this.state.name} />
            </label>
          </form>
        );
    }
}

ReactDOM.render(<CountrySelector />, document.getElementById('selectCountryForm'));
ReactDOM.render(<InformationSelector />, document.getElementById('selectInformationTypes'));
